import React from 'react';
import { Link } from 'react-router-dom';
import Button from 'react-bootstrap/Button';

const Home = () => {
    return (
        <div className="App">
            <div className="content-container">
                <h1>About</h1>
                <p>This is where an about box would go</p>
                <Link to={'./projects'}>
                    <Button>
                        Projects
                    </Button>
                </Link>
            </div>
        </div>
    )
}

export default Home;
